import React from 'react'

const ListMovies = ({ListMovies}) => {
    const renderedListMovie=ListMovies.map(movie=>{
        return <li>{movie.title}</li>
    })
    return (
        <div>
            <ul>
                {renderedListMovie}
            </ul>
        </div>
    )
}

export default ListMovies
